// export default Navbar;

export function Navbar() {
    // const { user, setUser } = useContext(UserContext);
    const { user } = useContext(UserContext);
    return(
        <nav className="nav-wrapper">
            <div className="container">
                <Link to="/" className="brand-logo">The 116 Tech Shop</Link>

                <ul className="right">
                    <li className="navDescription"> <Link to="/">Home</Link></li>
                    <li className="navDescription"><Link to="/cart">View Cart</Link></li>
                    <li><Link to="/cart"><i className="material-icons">shopping_cart</i></Link></li>
                    { user ? 
                    <div> 
                        <li className="navDescription login-button"><Link to="/register">Register</Link></li>
                        <li className="navDescription login-button"><Link to="/login">Login</Link></li>
                    </div>
                    : 
                    <div> 
                    <li className="navDescription login-button"><Link to="/register">Register</Link></li>
                    <li className="navDescription login-button"><Link to="/login">Login</Link></li>
                    </div>}
                    
                </ul>
            </div>
        </nav> 
    )
}
